import React from 'react'

export default function Product({product}){
    return (
        <div className='product'>
            <p>name : {product.name}</p>
            <p>categorie : {product.categorie}</p>
            <p>prix : {product.prix}</p>
            <p>quanity : {product.quanity}</p>
        </div>
    )
}
